headerButton.customFunction:
const TRANSLATION = {
  target: '대상',
  timestamp: '시간',
  unbal: '전압 불균형_%',
  f1_type: '상형태',
  f1_volt1: '전압1_V',
  f1_volt2: '전압2_V',
  f1_volt3: '전압3_V',
  f1_amp1: '전류1_A',
  f1_amp2: '전류2_A',
  f1_amp3: '전류3_A',
  f1_watt: '유효전력_W',
  f1_var: '무효전력_var',
  f1_VA: '피상전력_VA',
  f1_PF: '역률_%',
  f1_kwh_imp: '누적전력량_kWh',
  frequency: '주파수_Hz',
  f1_unbal: '전류 불균형_%',
  f1_thd: 'THD_%',
  expect: '추정상태',
  result: '수정상태'
};
const TYPE = [
  'not used',
  '1P2W_R(1P3W_RN)',
  '1P2W_S(1P3W_RS)',
  '1P2W_T(1P3WSN)',
  '3P3W_2CT',
  '3P4W',
  'ZCT',
  '3P3W_3CT',
  '1P3W_2CT'
];

let timeList = [];
let target = widgetContext.datasources[0].entityLabel;
let dataKeys = widgetContext.datasources[0].dataKeys.map(x => x.name);
let dataLength = widgetContext.data.length;
for (let i = 0; i < dataLength; i++) {
  let subDataLength = widgetContext.data[i].data.length;
  for (let j = 0; j < subDataLength; j++) {
    // 이전 데이터와 30초 이상 차이가 나는 경우
    if (
      widgetContext.data[i].data[j - 1] &&
      widgetContext.data[i].data[j][0] - widgetContext.data[i].data[j - 1][0] >= 30 * 1000
    ) {
      timeList.push(widgetContext.data[i].data[j][0]);
    }

    // 분단위 까지 반올림
    if (moment(widgetContext.data[i].data[j][0]).format('mm') - 30 < 0) {
      widgetContext.data[i].data[j][0] = moment(widgetContext.data[i].data[j][0]).startOf('minute').valueOf();
      timeList.push(widgetContext.data[i].data[j][0]);
    } else {
      widgetContext.data[i].data[j][0] = moment(widgetContext.data[i].data[j][0]).endOf('minute').valueOf() + 1;
      timeList.push(widgetContext.data[i].data[j][0]);
    }
  }
  timeList = _uniq(timeList);
}
timeList.sort((a, b) => a - b);

let mainData = {};
let timeListLength = timeList.length;
for (let i = 0; i < timeListLength; i++) {
  mainData[timeList[i]] = {
    target: target,
    timestamp: moment(timeList[i]).format('YYYY-MM-DD HH:mm'),
    unbal: '',
    f1_type: '',
    f1_volt1: '',
    f1_volt2: '',
    f1_volt3: '',
    f1_amp1: '',
    f1_amp2: '',
    f1_amp3: '',
    f1_watt: '',
    f1_var: '',
    f1_VA: '',
    f1_PF: '',
    f1_kwh_imp: '',
    frequency: '',
    f1_unbal: '',
    f1_thd: '',
    expect: '',
    result: ''
  };
}

for (let i = 0; i < dataLength; i++) {
  let name = widgetContext.data[i].dataKey.name;
  let subDataLength = widgetContext.data[i].data.length;

  for (let j = 0; j < subDataLength; j++) {
    if (mainData[widgetContext.data[i].data[j][0]]) {
      mainData[widgetContext.data[i].data[j][0]][name] = widgetContext.data[i].data[j][1];
    }
  }
}

// mainData를 mergeData로 깊은 복사
let mergeData = JSON.parse(JSON.stringify(mainData));

//mainData에서 unbal키가 빈 값인 경우 삭제
for (let i in mainData) {
  if (mainData[i].unbal === '') {
    delete mainData[i];
  }
}

// mergeData에서 unbal키가 빈 값이 아닌 경우 삭제
for (let i in mergeData) {
  if (mergeData[i].unbal !== '') {
    delete mergeData[i];
  }
}

// mainData의 unbal 키를 기준으로 +30초 내에 mergeData에 데이터가 있는 경우 mergeData의 값을 mainData로 병합
for (let i in mainData) {
  for (let j in mergeData) {
    if (Math.abs(i - j) <= 30 * 1000 && j > i) {
      for (let k in mergeData[j]) {
        if (k !== 'target' && k !== 'timestamp' && k !== 'unbal' && k !== 'expect' && k !== 'result') {
          if (mainData[i][k] == '') {
            mainData[i][k] = mergeData[j][k];
          }
        }
      }
    } else if (j > i) {
      break;
    }
    if (i > j) {
      delete mergeData[j];
    }
  }
}

// mainData중 expect, result를 제외한 키가 비어있을 경우 삭제
for (let i in mainData) {
  for (let j in mainData[i]) {
    if (j !== 'expect' && j !== 'result') {
      if (mainData[i][j] === '') {
        delete mainData[i];
        break;
      }
    }
  }
}

let csv = '';
for (let i in TRANSLATION) {
  csv += `${TRANSLATION[i]},`;
}
csv += '\r\n';

for (let i in mainData) {
  for (let j in mainData[i]) {
    if (j === 'f1_type') {
      if (mainData[i][j]) {
        csv += `${TYPE[mainData[i][j]]},`;
      } else {
        csv += `,`;
      }
    } else {
      csv += `${mainData[i][j]},`;
    }
  }
  csv += '\r\n';
}

let fileName = target + ' ' + moment().format('YYYY-MM-DD/HH:mm') + `.csv`;
let blob = new Blob(['\ufeff' + csv], {
  type: 'application/csv;charset=utf-8;'
});
let elem = window.document.createElement('a');
elem.href = window.URL.createObjectURL(blob);
elem.download = fileName;
document.body.appendChild(elem);
elem.click();
document.body.removeChild(elem);

function _each(collection, iteratee) {
  // TODO: 여기에 코드를 작성합니다.
  //? 배열일 경우
  if (Array.isArray(collection)) {
    for (let i = 0; i < collection.length; i++) {
      iteratee(collection[i], i, collection);
    }
  }
  //? 객체일 경우
  else if (typeof collection === 'object' && collection !== null) {
    for (let key in collection) {
      iteratee(collection[key], key, collection);
    }
  }
}

function _uniq(arr) {
  let result = [];

  _each(arr, function (el) {
    if (result.indexOf(el) === -1) {
      result.push(el);
    }
  });
  return result;
}
